import React, { Fragment } from 'react';
import '../styles/App.css';

const LoginButton = () => {
  const submit = () => {
    fetch('http://localhost:5000/auth/login', {
      method: 'POST',
      headers: {
        'content-type': 'application/json',
      },
      body: JSON.stringify({
        email: 'test@test.com',
        password: '123456',
      }),
    });
  };
  const fetchUsers = () => {
    fetch('http://localhost:5000/users', {
      headers: {
        Authorization:
          'bearesr eyJhbGciOiJIUzI1NiJ9.NWU4ZjVhYmUzZDljZmUyNTg3MTI4ZGFk.NnPeLdURIYQFHWflezXV7W0m5rraOI1i3LVMfO7PLkM',
      },
    });
  };
  return (
    <Fragment>
      <button onClick={submit} className='LoginButton btn btn-light mb-4'>
        Login
      </button>
      <button onClick={fetchUsers} className='LoginButton btn btn-light mb-4'>
        Fetch users
      </button>
    </Fragment>
  );
};

export default LoginButton;
